const notes = [
    {
      key: 1,
      title: "Fav Quote",
      content:
        "Don't let you failures define who you are."
    },
    {
      key: 2,
      title: "Query",
      content:
        "Why is backtraking prioritised than vanila brute force?"
    },
    {
      key: 3,
      title: "Reminder",
      content:
        "Take your medicine"
    },
    {
      key: 4,
      title: "Hardware vs. Software",
      content:
        "What's the difference between hardware and software? You can hit your hardware with a hammer, but you can only curse at your software."
    },
    {
      key: 5,
      title: "Grab",
      content: "50% discount at Pizza Hut"
    }
  ];
  
  export default notes;
